import styled from "styled-components";
const Tag = styled.div`
  border: 1px solid black;
  padding: 10px 20px;
  margin: 8px 8px;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  align-items: center;
`;
console.log(Tag);
export default function Tags(props) {
    return (
        <Tag>
            <div>
                <p>{props.name}</p>
                <div>{props.tag}</div>
            </div>
            <div>开始</div>
        </Tag>
    )
}
